import React from 'react'

const VideoCard = ({ products }) => {
    return (
        <>
            <div className='w-96 h-80 rounded-lg mx-4 my-2 border border-white hover:shadow-lg cursor-pointer hover:bg-cyan-900 text'>
                <img className='w-[383px] h-[170px] ' src={products.thumbnail} alt="loading..." />
                <div className='text-2xl text-center'>{products.title}</div>
                <div className='text-xl font-thin'>{products.description}</div>
            </div>
        </>
    )
}

export default VideoCard
